            <CloseIcon type="primary" />
            <p className="text text_type_digits-large" style={{textShadow: '0px 0px 16px rgba(51, 51, 255, 0.25), 0px 0px 8px rgba(51, 51, 255, 0.25), 0px 4px 32px rgba(51, 51, 255, 0.5)'}}>034536</p>
